const kengai_number=999999999

init_pokemon_list.map((p, i) => {
  const temp_poke = pokemon_used_ranking.find((a) => p.pokedex === a.id && p.form_number === a.form);
  if (temp_poke) {
    p.used_rank = pokemon_used_ranking.indexOf(temp_poke) + 1;
  } else {
    p.used_rank = kengai_number;
  }
});

const pokemon_list = init_pokemon_list.sort((a, b) =>
  a.used_rank - b.used_rank === 0
    ? a.pokedex - b.pokedex
    : a.used_rank - b.used_rank
).filter((a)=>a.used_rank!==kengai_number);

export default pokemon_list;

export const pokemon_array = [] as Array<Array<Pokemon>>
let temp_list = [] as Array<Pokemon>
pokemon_list.forEach((p,i) => {
    temp_list.push(p)
    if (temp_list.length>=10){
        pokemon_array.push(temp_list)
        temp_list=[]
    }
});
if (temp_list.length>0){
    pokemon_array.push(temp_list)
    temp_list=[]
}

